Immersion is the upcoming third studio album from the drum &amp; bass/electronica band Pendulum. The album was announced in early 2009, with the name being confirmed in December 2009. The album is set to be released May 24, 2010, followed by a UK tour of the album. In January 2010 Pendulum hosted the album preview Ear Storm event at Matter in London in which many top DJs
performed sets of their own with Pendulum being the headliners.

The album was mastered by Brian Gardner at Bernie Grundman Mastering Studios in Los Angeles. The album was finished on 18 April 2010, as confirmed by Rob Swire's twitter feed.

